INSERT INTO public.quotes VALUES ('3uYBn42Cl2w', '"Use what talents you possess; the woods would be very silent if no birds sang there except those that sang best."', 'Henry van Dyke Jr.', '[Wisdom]', 'henry-van-dyke-jr', '112', '2021-04-08 00:00:00', '2023-04-15 00:00:00');
