INSERT INTO public.quotes VALUES ('ZIPQXFULbx0', '"The truth is not for all men, but only for those who seek it."', 'Ayn Rand', '[Wisdom]', 'ayn-rand', '61', '2021-03-26 00:00:00', '2023-04-15 00:00:00');
