INSERT INTO public.quotes VALUES ('M_3sjCS_e7k2', '"Life is a gift, and it offers us the privilege, opportunity, and responsibility to give something back by becoming more"', 'Tony Robbins', '[Famous Quotes]', 'tony-robbins', '119', '2019-03-24 00:00:00', '2023-04-15 00:00:00');
