INSERT INTO public.quotes VALUES ('Ilvlt1O0thk7', '"We know what we are but know not what we may be."', 'William Shakespeare', '[Famous Quotes]', 'william-shakespeare', '48', '2019-09-08 00:00:00', '2023-04-15 00:00:00');
