INSERT INTO public.quotes VALUES ('nFekPJy-f7', '"Many sophisticated, intelligent people lack wisdom and common sense."', 'Joyce Meyer', '[Wisdom]', 'joyce-meyer', '68', '2019-01-08 00:00:00', '2023-04-15 00:00:00');
INSERT INTO public.quotes VALUES ('idKyHYiBkP', '"I love wisdom. And you can never be great at anything unless you love it. Not be in love with it, but love the thing, admire the thing. And it seems that if you love the thing, and you don$t just want to possess it, it will find you."', 'Maya Angelou', '[Wisdom]', 'maya-angelou', '233', '2021-03-08 00:00:00', '2023-04-15 00:00:00');
