INSERT INTO public.quotes VALUES ('cldBH7aZAkC_', '"Quality is never an accident; it is always the result of intelligent effort."', 'John Ruskin', '[Famous Quotes]', 'john-ruskin', '76', '2019-02-17 00:00:00', '2023-04-15 00:00:00');
INSERT INTO public.quotes VALUES ('jUzHSANe7yNC', '"He that respects himself is safe from others; he wears a coat of mail that none can pierce."', 'Henry Wadsworth Longfellow', '[Famous Quotes]', 'henry-wadsworth-longfellow', '91', '2019-09-08 00:00:00', '2023-04-15 00:00:00');
INSERT INTO public.quotes VALUES ('amp7znlTRP', '"I don$t need a friend who changes when I change and who nods when I nod; my shadow does that much better."', 'Plutarch', '[Friendship]', 'plutarch', '105', '2019-02-20 00:00:00', '2023-04-15 00:00:00');
INSERT INTO public.quotes VALUES ('KsySq34Vlt3', '"There is no greater harm than that of time wasted."', 'Michelangelo', '[Famous Quotes]', 'michelangelo', '50', '2021-04-15 00:00:00', '2023-04-15 00:00:00');
INSERT INTO public.quotes VALUES ('q3SfzGZd2iGb', '"The most complicated achievements of thought are possible without the assistance of consciousness."', 'Sigmund Freud', '[Famous Quotes]', 'sigmund-freud', '98', '2020-03-27 00:00:00', '2023-04-15 00:00:00');
INSERT INTO public.quotes VALUES ('Vd5Yj4doqaZe', '"I don$t believe in failure. It$s not failure if you enjoyed the process."', 'Oprah Winfrey', '[Famous Quotes]', 'oprah-winfrey', '72', '2019-08-08 00:00:00', '2023-04-15 00:00:00');
