INSERT INTO public.quotes VALUES ('JnLIpceVj6AD', '"Either I will find a way, or I will make one."', 'Philip Sidney', '[Famous Quotes]', 'philip-sidney', '45', '2020-01-26 00:00:00', '2023-04-15 00:00:00');
