INSERT INTO public.quotes VALUES ('moXX0J8RnNP_', '"Until you make peace with who you are, you$ll never be content with what you have."', 'Doris Mortman', '[Famous Quotes]', 'doris-mortman', '82', '2019-04-05 00:00:00', '2023-04-15 00:00:00');
INSERT INTO public.quotes VALUES ('_2iWk5KE6Xc5', '"Anything you really want, you can attain, if you really go after it."', 'Wayne Dyer', '[Famous Quotes]', 'wayne-dyer', '68', '2019-06-27 00:00:00', '2023-04-15 00:00:00');
INSERT INTO public.quotes VALUES ('a86E0FlaTY', '"How is it possible that a being with such sensitive jewels as the eyes, such enchanted musical instruments as the ears, and such fabulous arabesque of nerves as the brain can experience itself anything less than a god."', 'Alan Watts', '[Philosophy]', 'alan-watts', '218', '2022-03-12 00:00:00', '2023-04-15 00:00:00');
