INSERT INTO public.quotes VALUES ('rMjF0mP5jls', '"It$s easier to resist at the beginning than at the end."', 'Leonardo da Vinci', '[Wisdom]', 'leonardo-da-vinci', '55', '2020-02-22 00:00:00', '2023-04-15 00:00:00');
