INSERT INTO public.quotes VALUES ('r9VIoOzFdUGU', '"The conditions of conquest are always easy. We have but to toil awhile, endure awhile, believe always, and never turn back."', 'Seneca the Younger', '[Famous Quotes]', 'seneca-the-younger', '123', '2021-01-19 00:00:00', '2023-04-15 00:00:00');
