INSERT INTO public.quotes VALUES ('p2TBigKMHh', '"In romance, we feel the need to zoom in and expound on our partner$s foibles in intimate detail; in friendship, we tend to do the opposite, avoiding confrontation through fear, lethargy or both."', 'Mariella Frostrup', '[Friendship]', 'mariella-frostrup', '194', '2020-12-06 00:00:00', '2023-04-15 00:00:00');
