INSERT INTO public.quotes VALUES ('d79yOltfl35h', '"Genuine sincerity opens people$s hearts, while manipulation causes them to close."', 'Daisaku Ikeda', '[Character]', 'daisaku-ikeda', '81', '2019-01-14 00:00:00', '2023-04-15 00:00:00');
INSERT INTO public.quotes VALUES ('psDF8kzy2M', '"You are not here merely to make a living. You are here in order to enable the world to live more amply, with greater vision, with a finer spirit of hope and achievement. You are here to enrich the world, and you impoverish yourself if you forget the errand."', 'Woodrow Wilson', '[Inspirational]', 'woodrow-wilson', '257', '2019-11-16 00:00:00', '2023-04-15 00:00:00');
INSERT INTO public.quotes VALUES ('dHt4eLA3KL', '"I think that novels that leave out technology misrepresent life as badly as Victorians misrepresented life by leaving out sex."', 'Kurt Vonnegut', '[Technology]', 'kurt-vonnegut', '126', '2020-08-27 00:00:00', '2023-04-15 00:00:00');
