INSERT INTO public.quotes VALUES ('lvcJukDLhxz3', '"The difference between what we do and what we are capable of doing would suffice to solve most of the world$s problems."', 'Mahatma Gandhi', '[Wisdom]', 'mahatma-gandhi', '119', '2019-12-02 00:00:00', '2023-04-15 00:00:00');
