INSERT INTO public.quotes VALUES ('yBn9DgK3vf', '"A youth, when at home, should be filial and, abroad, respectful to his elders. He should be earnest and truthful. He should overflow in love to all and cultivate the friendship of the good. When he has time and opportunity, after the performance of these things, he should employ them in polite studies."', 'Confucius', '[Friendship]', 'confucius', '303', '2019-02-17 00:00:00', '2023-04-15 00:00:00');
