INSERT INTO public.quotes VALUES ('qXO3CA1R5kmS', '"Take up one idea. Make that one idea your life - think of it, dream of it, live on that idea. Let the brain, muscles, nerves, every part of your body, be full of that idea, and just leave every other idea alone. This is the way to success."', 'Swami Vivekananda', '[Success]', 'swami-vivekananda', '239', '2021-05-12 00:00:00', '2023-04-15 00:00:00');
