INSERT INTO public.quotes VALUES ('z4yEYvKjp0T', '"While we stop to think, we often miss our opportunity."', 'Publilius Syrus', '[Famous Quotes]', 'publilius-syrus', '54', '2021-01-11 00:00:00', '2023-04-15 00:00:00');
